    //     }
    //     fetchProducts()
    // },[])
    const dispatch = useDispatch();
    useEffect(() => {
        dispatch(listProducts());
      }, [dispatch]);

  return (
  <>
  <Row>
      {Products.map((product) => (
      <Col key={product._id} md={4}>
      <Productscreen product= {product}/>
      </Col>
      ))}
  </Row>
  </>
      );
};

export default Homescreen;
